import React from 'react';
import { 
    ProfileWrapper,
    ProfileRow,
    ProfileText,
    ProfileView,
    ProfileImageBackground
} from '../components/profile.styles';
import { LayoutScrollView } from '../../../components/Layout';
import Header from '../../../components/Header';
import MenuScreen from '../Drawer/MenuScreen';

export default function ProfileScreen() {
    return (
     <LayoutScrollView
        style={{
          paddingHorizontal: 25,
        }}
      >
        <ProfileWrapper>
          <ProfileRow>
             <Header 
              iconLeft={require("../../../../assets/backIcon.png")}
             />
          </ProfileRow>
          <ProfileRow>
            <ProfileText>Your Profile</ProfileText>
          </ProfileRow>
          <ProfileRow>
            <MenuScreen />
          </ProfileRow>
        </ProfileWrapper>
        <ProfileView>
           <ProfileImageBackground source={require("../../../../assets/profile2.png")} />
        </ProfileView>
     </LayoutScrollView>
    );
}
